import { getErrDetail, delAllError } from "../../../api/monitor/log";
import Search from "./search";
import CRUD, { presenter } from "../../../components/Crud/crud";
import crudOperation from "../../../components/Crud/CRUD.operation";
import pagination from "../../../components/Crud/Pagination"; // crud交由presenter持有

var defaultCrud = CRUD({
  title: '异常日志',
  url: 'api/logs/error'
});
export default {
  name: 'ErrorLog',
  components: {
    Search: Search,
    crudOperation: crudOperation,
    pagination: pagination
  },
  mixins: [presenter(defaultCrud)],
  data: function data() {
    return {
      errorInfo: '',
      dialog: false
    };
  },
  created: function created() {
    this.crud.optShow = {
      add: false,
      edit: false,
      del: false,
      download: true
    };
  },
  methods: {
    // 获取异常详情
    info: function info(id) {
      var _this = this;

      this.dialog = true;
      getErrDetail(id).then(function (res) {
        _this.errorInfo = res.exception;
      });
    },
    confirmDelAll: function confirmDelAll() {
      var _this2 = this;

      this.$confirm("\u786E\u8BA4\u6E05\u7A7A\u6240\u6709\u5F02\u5E38\u65E5\u5FD7\u5417?", '提示', {
        confirmButtonText: '确定',
        cancelButtonText: '取消',
        type: 'warning'
      }).then(function () {
        _this2.crud.delAllLoading = true;
        delAllError().then(function (res) {
          _this2.crud.delAllLoading = false;

          _this2.crud.dleChangePage(1);

          _this2.crud.delSuccessNotify();

          _this2.crud.toQuery();
        }).catch(function (err) {
          _this2.crud.delAllLoading = false;
          console.log(err.response.data.message);
        });
      }).catch(function () {});
    }
  }
};
